import {createRouter, createWebHistory} from 'vue-router';

import dashboardd from '@/pages/dashboard.vue';

const routes = [
    {
        path: '/',
        name: 'Dashboard',
        component: dashboard
    }
];

const router = Router();

export default router;
function Router() {
    const router = new createRouter({
        history: createWebHistory(),
        routes,
    });
    return router;
}
